import React, { useEffect } from 'react'
import { useHistory, BrowserRouter } from 'react-router-dom'

export default function Produits() {
    let history = useHistory();

    useEffect(() => {
        history.push('/produits')
    }, [])

    return (
        <div>
            hello
        </div>
    )
}
